import {
  faSmile,
  faMeh,
  faFrown,
  faGrinStars,
} from "@fortawesome/free-solid-svg-icons";
export const icons = [
  { icon: faGrinStars, color: "text-theme-blue", borderColor:"border-theme-blue", descText: "I love it!" },
  { icon: faSmile, color: "text-theme-blue-l-1", borderColor:"border-theme-blue-l-1", descText: "I like it" },
  { icon: faMeh, color: "text-theme-blue-l-2", borderColor:"border-theme-blue-l-2", descText: "Meh." },
  { icon: faFrown, color: "text-theme-blue-l-3", borderColor:"border-theme-blue-l-3", descText: "I don't like it" },
];
